INSERT INTO `board` VALUES ('','<YaneoduSQLD를 오픈하였습니다!>','많은 관심 부탁드립니다!\n\n-운영자 올림-','2020-11-14 13:57:31','',1),('','11월 22일 토요일 SQLD 시험 ','안녕하세요 야너두 SQLD 딸 수 있어 개발자 팀입니다. \n이번 11월 22일에 SQLD 시험이 있습니다.\n수험생 여러분들 모두 좋은 결과 있으시길 바랍니다.\n\n','2020-11-15 17:00:39','',39),('','11월 15일 일요일 버그수정','안녕하세요 야너두 SQLD 딸 수 있어 개발자 팀입니다.\n오늘 제보된 버그및 오타 수정했습니다.\n\n내용은 다음과 같습니다 .\n\n---------------\n\n\n\n---------------\n\n감사합니다.  ','2020-11-15 17:02:50','',40);
