INSERT INTO `sqldquiz` VALUES (1,'다음 중 데이터베이스 테이블 제약조건(Constratint)에 대한 설명으로 가장 부적절한 것은?','1. 기본키(Primary Key)는 반드시 테이블 당 하나의 제약만을 정의할 수 있다.','2. 고유키(Unique Key)로 지정된 모든 컬럼들은 Null값을 가질 수 없다.','3. 외래키(Foreign Key)는 테이블간의 관계를 정의하기 위해 기본키(Primary Key)를 다른 테이블의 외래키가 참조하도록 생성한다.','4. Check 제약조건(Constraint)은 데이터베이스에서 데이터의 무결성을 유지하기 위하여 테이블의 특정 컬럼(Column)에 설정하는 제약이다.',2,'고유키(Unique Key)로 지정된 모든 컬럼은 Null값을 가질 수도 있다.','sql 기본'),(2,'다음 중 물리적 테이블 명으로 가장 적절한 것은?','1. EMP_10','2. 100-EMP','3. EMP-100','4. 100_EMP',1,'테이블명과 칼럼명은 반드시 문자로 시작해야 한다. 사용되는 글자는 A-Z, a-z, 0-9, _, $, #만 허용.','sql 기본'),(3,'다음 중 NULL의 설명으로 가장 부적절한 것은?','1. 모르는 값을 의미한다.','2. 값의 부재를 의미한다.','3. NULL과의 모든 비교(IS NULL제외)는 알 수 없음(Unknown)을 반환한다.','4.공백문자(Empty String) 혹은 숫자 0을 의미한다.',4,'NULL은 공백문자 혹은 숫자 0과 동일하지 않다.','sql 기본'),(4,'개발 프로젝트의 표준은 모든 삭제 데이터에 대한 로그를 남기는 것을 원칙으로 하고, \n테이블 삭제의 경우는 허가된 인력만이 정기적으로 수행 가능하도록 정하고 있다. \n개발팀에서 사용 용도가 없다고 판단한 STADIUM 테이블의 데이터를 삭제하는 \n가장 좋은 방법은 무엇인가?','1. DELETE * FROM STADIUM;','2. DROP TABLE STADIUM;','3. DELETE FROM STADIUM;','4. TRUNCATE TABLE STADIUM;',3,'TRUNCATE TABLE과 DROP TABLE은 로그를 남기지 않으므로 개발 기준과 상충된다. \n1번은 문법에 맞지 않다.','sql 기본'),(5,'다음 중 아래와 같은 상황에서 사용할 수 있는 SQL 명령어는?\n\n*아래*\n우리가 관리하는 데이터베이스의 \"매출\" 테이블이 너무나 많은 디스크 용량을 차지하여 \"매출\" 테이블에서 필요한 데이터만을 추출하여 별도의 테이블로 옮겨 놓았다. 이후 \"매출\" 원본 테이블의 데이터를 모두 삭제 함과 동시에, 디스크 사용량도 초기화 하고자 한다.\n(단, \"매출\" 테이블의 스키마 정의는 유지한다.)','1. TRUNCATE TABLE 매출;','2. DELETE FROM 매출;','3. DELETE TABLE FROM 매출;','4. DROP TABLE 매출;',1,'특정 테이블의 모든 데이터를 삭제하고, 디스크 사용량을 초기화 하기 위해서는 TRUNCATE TABLE 명령을 사용하여야 한다.\n\n2. DELETE TABLE은 테이블의 모든 데이터를 삭제하지만, 디스크 사용량을 초기화하지는 않는다.\n\n3. DELETE TABLE FROM은 존재하지 않는 명령어다.\n\n4. DROP TABLE은 테이블의 데이터를 모두 삭제하고 디스크 사용량도 초기화할 수 있지만, 테이블의 스키마 정의도 함께 삭제된다.','sql 기본'),(6,'아래 내용의 (A), (B), (C) 에 해당하는 단어를 순서대로 나열한 것은?\n\n*아래*\n(A)는(은) 데이터베이스의 논리적 연산단위로서 밀접히 관련되어 분리될 수 없는 한 개 이상의 데이터베이스 조작을 가리킨다. (A)의 종료를 위한 대표적 명령어로서는 데이터에 대한 변경사항을 데이터베이스에 영구적 으로 반영하는 (B)와(과) 데이터에 대한 변경사항을 모두 폐기하고 변경전의 상태로 되돌리는 (C)가(이) 있다.','1. 트랜잭션(Transaction), 딜리트(Delete), 셀렉트(Select)','2. 업데이트(Update), 커밋(Commit), 롤백(Rollback)','3. 트랜잭션(Transaction), 커밋(Commit), 롤백(Rollback)','4. 그랜트(Grant), 리보크(Revoke), 드랍(DROP)',3,'Rollback 구문은 Commit되지 않은 상위의 모든 Transaction을 모두 Rollback한다.','sql 기본'),(7,'아래의 (A)에 들어갈 내용을 적으시오.\n\n*아래*\nSQL을 사용하여 데이터베이스에서 데이터를 조회할 때 원하는 데이터만을 검색하기 위해서 SELECT, FROM절과 함께 (A)를(을) 이용하여 조회되는 데이터의 조건을 설정하여 데이터를 제한할 수 있다.','1. ORDER BY','2. GROUP BY','3. AS','4. WHERE',4,'WHERE절은 SQL을 이용하여 데이터베이스로부터 데이터를 검색할 때 조회되어야 하는 데이터를 필터링하는데 사용된다.','sql 기본'),(8,'오라클환경에서 날짜형 데이터를 다룰 경우, 아래 SQL 결과로 가장 적절한 것은?\n\n*아래*\nSELECT TO_CHAR(TO_DATE(\'2015.01.10 10\', \'YYYY.MM.DD HH24\') + 1 / 24 / (60/10), \'YYYY.MM.DD HH24:MI:SS\') FROM DUAL;','1. 2015.01.10 11 : 01: 00','2. 2015.01.10 10 : 05 : 00','3. 2015.01.10 10 : 10 : 00','4. 2015.01.10. 10 : 30 : 00',3,'오라클에서 날짜의 연산은 숫자의 연산과 같다. 특정 날짜에 1을 더하면 하루를 더한 결과와 같으므로 1 / 24 / 60 = 1분을 의미한다. 1 / 24 / (60 / 10) = 10분과 같으므로 2015년 01월 10일 10시에 10분을 더한 결과와 같다.','sql 기본'),(9,'어느 기업의 직원 테이블(EMP)이 직급(GRADE) 별로 사원 500명, 대리 100명, 과장 30명, 차장 10명, 부장 5명, 직급이 정해지지 않은(NULL) 사람 25명으로 구성되어 있을 때, 다음 중 SQL문을 SQL)1부터 SQL)3까지 순차적으로 실행한 결과 건수를 순서대로 나열한 것으로 가장 적절한 것은?\n\n*아래*\nSQL1) SELECT COUNT(GRADE) FROM EMP;\nSQL2) SELECT GRADE FROM EMP WHERE GRADE IN (\'차장\', \'부장\', \'널\');\nSQL3) SELECT GRADE, COUNT(*) FROM EMP GROUP BY GRADE;','1. 645, 15, 6','2. 670, 15, 5','3. 645, 40, 5','4. 670, 40, 6',1,'SQL1) 645건 : 사원 500명 + 대리 100명 + 과장 30명 + 차장 10명 + 부장 5명\n(이때, NULL 25건은 제외된다.)\n\nSQL2) 15건 : 차장 10명 + 부장 5명\n\'널\' 이 텍스트로 입력된 데이터는 없다고 봐야 함\n정의되지 않은 미지의 값인 NULL과 \'널\' 텍스트 데이터는 다름, 또한 IN(\'차장\', \'부장\', NULL)로 변경하여도 실제 NULL 데이터는 출력되지 않음.\nNULL 비교는 오직 \'IS NULL, IS NOT NULL\'만 가능\n\nSQL3) 6건 : 5개 직급 + NULL 기준별 데이터 수가 6건 출력됨','sql 기본'),(10,'다음 중 SELECT 문장의 실행 순서를 올바르게 나열한 것은?','1. FROM - WHERE - GROUP BY - HAVING - SELECT - ORDER BY','2. FROM - SELECT - WHERE - GROUP BY - HAVING - ORDER BY','3. FROM - WHERE - GROUP BY - HAVING - ORDER BY - SELECT','4. SELECT - FROM - WHERE - OREDR BY - HAVING - GROUP BY',1,'SELECT 문장의 실행 순서는 FROM - WHERE - GROUP BY - HAVING - SELECT - ORDER BY이다.','sql 기본'),(13,'다음중 데이터 제어어에 해당하는 명령어는?','INSERT','RENAME','COMMIT','REVOKE',4,'데이터 제어어는 데이터베이스에 접근하고 객체들을 사용할 수 있도록 권한을 부여하거나\n회수하는 명령어로 GRANT, REVOKE가 있다.','sql 기본');
